const AdmZip = require('adm-zip');
const fs = require('fs');
const path = require('path');

const docxFiles = [
    {name: 'HE-100', file: 'Productos/ELECTRDOS ELECTROMAGNETICOS HUNTER ENERGY HE/ELECTRODO ELECTROMAGNETICO HE 100  (HE).docx'},
    {name: 'HE-200', file: 'Productos/ELECTRDOS ELECTROMAGNETICOS HUNTER ENERGY HE/ESPECIFICACIÓN TÉCNICA EETT ELECTRODO HE-200.docx'},
    {name: 'HE-400', file: 'Productos/ELECTRDOS ELECTROMAGNETICOS HUNTER ENERGY HE/ELECTRODO ELECTROMAGNETICO HE-400  (HE) 2025.docx'},
    {name: 'HE-700', file: 'Productos/ELECTRDOS ELECTROMAGNETICOS HUNTER ENERGY HE/ELECTRODO ELECTROMAGNETICO HE-700  (HE).docx'},
];

const outDir = path.join(process.cwd(), 'tmp_ficha_images');
fs.mkdirSync(outDir, {recursive: true});

for (const {name, file} of docxFiles) {
    const zip = new AdmZip(file);
    const entries = zip.getEntries();
    for (const entry of entries) {
        if (entry.entryName.includes('media/') && entry.entryName.endsWith('.png')) {
            const imgName = name + '_' + path.basename(entry.entryName);
            const outPath = path.join(outDir, imgName);
            fs.writeFileSync(outPath, entry.getData());
            console.log('Extracted: ' + imgName);
        }
    }
}
console.log('Done. Output dir: ' + outDir);
